INSERT INTO regulation (regulation_id, regulation_name, target, pdf_file_path, regulation_description, expire_date, created_by_admin) VALUES
    (N'BA18C4FD-46A0-44AC-91A4-06A5F68773C6', N'Quy chế tuyển sinh và đào tạo Thạc sĩ', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Admission_and_Training_Regulations_for_Master''s_Programs.pdf', N'Quy định chi tiết về quy trình tuyển sinh, điều kiện dự tuyển, hình thức đào tạo, chương trình học, thời gian đào tạo, điều kiện tốt nghiệp và cấp bằng cho sinh viên theo học chương trình Thạc sĩ. Bao gồm các quy định về luận văn, hội đồng chấm luận văn, tiêu chuẩn đầu ra và quyền lợi của học viên cao học.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'889AB5F8-9B08-45FF-AC17-2EFD752584B3', N'Quy chế tuyển sinh và đào tạo Thạc sĩ', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Admission_and_Training_Regulations_for_Master''s_Programs.pdf', N'Quy định chi tiết về quy trình tuyển sinh, điều kiện dự tuyển, hình thức đào tạo, chương trình học, thời gian đào tạo, điều kiện tốt nghiệp và cấp bằng cho sinh viên theo học chương trình Thạc sĩ. Bao gồm các quy định về luận văn, hội đồng chấm luận văn, tiêu chuẩn đầu ra và quyền lợi của học viên cao học.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'ACC46091-F1D9-4212-B320-C56A227A8356', N'Quy định sử dụng cơ sở vật chất', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Regulations_on_the_Use_of_Facilities.pdf', N'Quy định về việc sử dụng và quản lý các cơ sở vật chất của trường bao gồm phòng học, giảng đường, thư viện, phòng thí nghiệm, phòng máy tính, khu thể thao, ký túc xá. Hướng dẫn đăng ký sử dụng, quy tắc ứng xử, bảo quản tài sản, xử lý vi phạm và trách nhiệm của sinh viên khi sử dụng các tiện ích chung của nhà trường.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'2006C9C2-9587-40EE-8A4D-1CEC2660F432', N'Quy định sử dụng cơ sở vật chất', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Regulations_on_the_Use_of_Facilities.pdf', N'Quy định về việc sử dụng và quản lý các cơ sở vật chất của trường bao gồm phòng học, giảng đường, thư viện, phòng thí nghiệm, phòng máy tính, khu thể thao, ký túc xá. Hướng dẫn đăng ký sử dụng, quy tắc ứng xử, bảo quản tài sản, xử lý vi phạm và trách nhiệm của sinh viên khi sử dụng các tiện ích chung của nhà trường.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'55A5E53D-16C2-4B31-AE26-8098D5268FA6', N'Quy định học phí và chính sách miễn giảm', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Tuition_Fees_and_Exemption_Policies.pdf', N'Quy định mức học phí theo từng ngành đào tạo, hình thức thanh toán, thời hạn nộp học phí, chính sách miễn giảm học phí cho sinh viên diện chính sách, sinh viên có thành tích học tập xuất sắc, sinh viên thuộc hộ nghèo, cận nghèo. Hướng dẫn thủ tục xin hoãn nộp học phí, xin hỗ trợ tài chính, vay vốn ngân hàng và các chế độ học bổng khác.', '2026-12-31', N'00000000-0000-0000-0000-000000000023'),
    (N'5DD3A45B-5794-449D-89F5-D2F9A2B07D0A', N'Quy định học phí và chính sách miễn giảm', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Tuition_Fees_and_Exemption_Policies.pdf', N'Quy định mức học phí theo từng ngành đào tạo, hình thức thanh toán, thời hạn nộp học phí, chính sách miễn giảm học phí cho sinh viên diện chính sách, sinh viên có thành tích học tập xuất sắc, sinh viên thuộc hộ nghèo, cận nghèo. Hướng dẫn thủ tục xin hoãn nộp học phí, xin hỗ trợ tài chính, vay vốn ngân hàng và các chế độ học bổng khác.', '2026-12-31', N'00000000-0000-0000-0000-000000000023'),
    (N'E844BE89-ECDB-4C13-8927-2131FA964DFE', N'Quy chế đào tạo đại học hệ chính quy', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Undergraduate_Training_Regulations.pdf', N'Quy định toàn diện về hệ thống đào tạo đại học chính quy bao gồm chương trình khung, phương thức tổ chức dạy và học, quy định về tín chỉ, đăng ký học phần, điều kiện dự thi, hình thức kiểm tra đánh giá, quy đổi điểm, xếp loại học lực. Các quy định về chuyển ngành, chuyển trường, tạm ngừng học, thôi học, điều kiện công nhận tốt nghiệp và cấp bằng tốt nghiệp đại học.', NULL, N'00000000-0000-0000-0000-000000000023'),
